import React, { Component } from 'react';
// import './WeekDisplay.css';

// source of code: 

class TestPage2 extends Component{
  render(){
    return (
    <div className='bounding-box'>
      { this.props.src && <img className=" cover bg-center" src={ this.props.src } alt={`CS50 stage week ${this.props.name}`} /> }

      { this.props.name === '' 
        ? <div />
        :
        <div className="ph4 ph5-m ph6-l">
          <div className="pv5 f4 f2-ns measure center">
            <h1 className="fw6 f1 fl w-100 black-70 mt0 mb3 avenir">{this.props.name}</h1>
            <strong className='f3'>Binary</strong>
            <p className="db lh-copy black-70 serif fw1 mv0 f4 f3-m f2-l measure baskerville">
              {this.props.binary}
            </p>
            <strong className='f3'>English</strong> 
            <p className="db lh-copy black-70 serif fw1 mv0 f4 f3-m f2-l measure baskerville">
              {this.props.english}
            </p>
            <strong className='f3'>Possible Reference</strong> 
            <p className="db lh-copy black-70 serif fw1 mv0 f4 f3-m f2-l measure baskerville">
              {this.props.comment}
            </p>
          </div>
        </div>
      }
    </div>
  );
  }  
}

export default TestPage2;
